--GO


-- Drop the table if it already exists
IF EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[Player].[Players]',N'U'))
DROP TABLE [Player].[Players]
GO


CREATE TABLE [Player].[Players] (
[Key_Id_Player] INT NOT NULL,
[Player_Id] VARCHAR(7) NOT NULL,
[Family_Name] VARCHAR(50),
[Given_Name] VARCHAR(50),
[Birth_Date] DATE,
[Goal_Keeper] CHAR(1),
[Defender] CHAR(1),
[Midfielder] CHAR(1),
[Forward] CHAR(1),
[Count_Tournaments] VARCHAR(5),
[List_Tournaments] VARCHAR(26),
[Player_Wikipedia_Link] VARCHAR(MAX)
CONSTRAINT [PK_Key_Id_Player]  PRIMARY KEY NONCLUSTERED
(
[Key_Id_Player] ASC
)WITH (PAD_INDEX = OFF, STATISTICS_NORECOMPUTE = OFF, IGNORE_DUP_KEY = OFF, ALLOW_ROW_LOCKS = ON, ALLOW_PAGE_LOCKS = ON, OPTIMIZE_FOR_SEQUENTIAL_KEY = OFF, DATA_COMPRESSION = NONE) ON [PRIMARY]
) ON [PRIMARY]
GO


ALTER TABLE [Player].[Players] WITH CHECK ADD CONSTRAINT [CK_Family_Name_PlayerPlayers] CHECK (Family_Name LIKE '%[a-zA-Z]%')
GO

ALTER TABLE [Player].[Players] WITH CHECK ADD CONSTRAINT [CK_Given_Name_PlayerPlayers] CHECK (Given_Name LIKE '%[a-zA-Z]%')
GO


EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Unique identification of each row.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Key_Id_Player'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Unique identification of each player.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Player_Id'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Last name of player.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Family_Name'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'First name of player.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Given_Name'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Birthday of player.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Birth_Date'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Indicator of goal keeper.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Goal_Keeper'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Indicator of defender' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Defender'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Indicator of midfielder.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Midfielder'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Indicator of forward.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Forward'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'Count of tournament appearances.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'Count_Tournaments'
GO

EXEC sys.sp_addextendedproperty @name=N'MS_Description', @value=N'List of tournament appearances.' , @level0type=N'SCHEMA',@level0name=N'Player', @level1type=N'TABLE',@level1name=N'Players', @level2type=N'COLUMN',@level2name=N'List_Tournaments'
GO

